import logo from './logo.svg';
import './App.css';
import LoginPage from './Component/LoginPage';
import Routes from './Routes/Routes';
import { Switch } from 'react-router-dom';

function App() {
  return (
    <Switch>
      <Route path="/home">
              <Home></Home>
      </Route>
      <Route path="/">
        <LoginPage></LoginPage>
      </Route>
    </Switch>
  );
}

export default App;
